import * as React from 'react';
import Link from '@mui/material/Link';
import Typography from '@mui/material/Typography';
import Title from './Title';
import {Button, Card, Grid, Image, Divider, Segment} from "semantic-ui-react";
import { List } from '@mui/material';

function preventDefault(event) {
  event.preventDefault();
}

export default function Deposits() {
  return (
    <React.Fragment>
      <Title>Current Badges</Title>
      <div>
        <List img>      
          <img src="https://loremflickr.com/320/240?lock=1" />
          <img src="https://loremflickr.com/320/240?lock=212" />
          <img src="https://loremflickr.com/320/240?lock=30976" />
        </List>
      <Button size='big' inverted>
        <Link to="/BussinessLogin" style={{color: 'mediumseagreen'}}> Generate New Badge </Link>
      </Button>
        <Link to href="http://Google.com" onClick={preventDefault} style={{color : 'mediumseagreen'}}>
          Generate New Badge
        </Link>
      </div>
    </React.Fragment>
  );
}
